import React from 'react';
import { KiteLogo } from '../../assets/svgAssets';
import PersonRoundedIcon from '@material-ui/icons/PersonRounded';
import { Button } from '@material-ui/core';
import './NavBar.scss';

const NavBar = ({ userInfo }) => {
  return (
    <div className="navbar w-100 d-flex justify-content-between">
      <KiteLogo className="ml-5"/>
      <div className="d-flex mr-5 align-items-center">
        <Button
          className="bg-primary h-25"
          type="submit"
          variant="contained"
          color="primary"
        >
          ADD SPOT
        </Button>
        <div className="d-flex flex-column align-items-center">
          <PersonRoundedIcon />
          <span>{userInfo.data?.name}</span>
        </div>
      </div>
    </div>
  );
};

export default NavBar;
